    false,nt"url": null,nt"notes": "The New Mexico meadow jumping mouse (Zapus
    hudsonius luteus) (jumping mouse) lives in dense riparian herbaceous vegetation
    along streams from southern Colorado to central New Mexico and eastern Arizona.
    It is a subspecies that has been of conservation concern since it was made a candidate
    for listing by the U. S. Fish and Wildlife Service (Service) under the Endangered
    Species Act of 1973, as amended (Act) in 2007 (72 FR 69033, December 6, 2007). On
    June 20, 2013, the Service proposed the jumping mouse as endangered after reviewing
    its status under the Act (78 FR 37163). This New Mexico meadow jumping mouse Species
    Status Assessment Report (SSA Report) is a summary of the information assembled
    and reviewed by the Service and incorporates the best scientific and commercial
    data available. This SSA Report documents the results of the comprehensive status
    review for the New Mexico meadow jumping mouse.",nt"license_title": "License
